import * as React from "react";
import ReactDOM from "react-dom";

export function ItemPaje(props) {
  const { data } = props;

  return (
    <div>
       {data.map((item) => (
        <div key={item.id} 
            style={{ height:"300px", width:"300px"}, {background:"#78866b"}}>
          <span>{item.id}</span><br/>
          <span>{item.name}</span><br/>
          <img style={{ height: "200px"}} src={`/imegesDoods/${item.photo}`}></img>
          <span>price: {item.price}</span>
        </div>
      ))}
    </div>
  );
}
